import * as React from 'react';
import AppBar from '@mui/material/AppBar';
import Button from '@mui/material/Button';
import CameraIcon from '@mui/icons-material/PhotoCamera';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import CssBaseline from '@mui/material/CssBaseline';
import Grid from '@mui/material/Grid';
import Stack from '@mui/material/Stack';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import Link from '@mui/material/Link';
import { createTheme, ThemeProvider } from '@mui/material/styles';

function Copyright() {
  return (
    <Typography variant="body2" color="text.secondary" align="center">
      {'Copyright Â© '}
      <Link color="inherit" href="https://mui.com/">
        Your Website
      </Link>{' '}
      {new Date().getFullYear()}
      {'.'}
    </Typography>
  );
}

const cards = [1, 2, 3, 4, 5, 6, 7, 8, 9];
const project_cards = [
  {
    title: "Project 1",
    description: "blah blah"
  },
  {
    title: "Barbiebook",
    description: "Created a barbie themed replica of Facebook. Features included: friends, home wall, feed, posting, commenting, and a page rank powered newsfeed"
  }
]

// TODO remove, this demo shouldn't need to reset the theme.
const defaultTheme = createTheme();

export default function Album() {
  return (
    <ThemeProvider theme={defaultTheme}>
      <CssBaseline />
      <AppBar position="relative" style={{ background: '#343840'}}>

        <Toolbar>
          <Typography variant="h6" color="inherit" noWrap>
            Aashvi Manakiwala
          </Typography>
        </Toolbar>
      </AppBar>
      <main>
        {/* Hero unit */}
        <Box
          sx={{
            // bgcolor: 'background.paper',
            // bgcolor: 'red',
            backgroundImage:`url(https://source.unsplash.com/snow-covered-mountains-during-daytime-VrAl7hRVX4A)`,
            // backgroundImage: `url(https://source.unsplash.com/a-close-up-of-a-window-with-rain-drops-pe_R74hldW4)`,
            backgroundRepeat: "no-repeat",
            backgroundSize: "cover",
            //height: "400px",
            pt: 8,
            pb: 6,
          }}
        >
          <Container maxWidth="sm">
            <Typography
              component="h1"
              variant="h2"
              align="center"
              color="text.primary"
              gutterBottom
            >
            About
            </Typography>
            <Typography variant="h5" align="center" color="text.secondary" paragraph>
              {/* Something short and leading about the collection belowâits contents,
              the creator, etc. Make it short and sweet, but not too short so folks
              don&apos;t simply skip over it entirely. */}

              Hey! I'm Aashvi Manakwala. 
              I'm currently a third-year pursuing a BS/MS in computer science at the University of Pennsylvania. 
              I love exploring emerging technologies with the hope of harnessing them to improve the world. 
              I also enjoy painting, traveling, and baking!
            </Typography>
            <Stack
              sx={{ pt: 4 }}
              direction="row"
              spacing={2}
              justifyContent="center"
            >
              {/* <Button variant="contained">Main call to action</Button>
              <Button variant="outlined">Secondary action</Button> */}
            </Stack>
          </Container>
        </Box>

        <Box
          sx={{
              // bgcolor: 'background.paper',
              bgcolor: '#343840',
              // backgroundImage:`url(https://source.unsplash.com/snow-covered-mountains-during-daytime-VrAl7hRVX4A)`,
              // backgroundImage: `url(https://source.unsplash.com/a-close-up-of-a-window-with-rain-drops-pe_R74hldW4)`,
              // backgroundRepeat: "no-repeat",
              // backgroundSize: "cover",
              //height: "400px",
              pt: 8,
              pb: 6
            }}
        >
          <Typography
              component="h1"
              variant="h2"
              align="center"
              color="text.primary"
        >
            Projects
        </Typography>

        <Container sx={{ py: 8}} maxWidth="md">

          {/* End hero unit */}
          <Grid container spacing={4}>
            {project_cards.map((card) => (
              <Grid item key={card} xs={12} sm={6} md={4}>
                <Card
                  sx={{ height: '100%', display: 'flex', flexDirection: 'column' }}
                >
                  <CardMedia
                    component="div"
                    sx={{
                      // 16:9
                      pt: '56.25%',
                    }}
                    image="https://source.unsplash.com/random?wallpapers"
                  />
                  <CardContent sx={{ flexGrow: 1 }}>
                    <Typography gutterBottom variant="h5" component="h2">
                      {card.title}
                    </Typography>
                    <Typography>
                      {card.description}
                    </Typography>
                  </CardContent>
                  <CardActions>
                    <Button size="small">View</Button>
                    <Button size="small">Edit</Button>
                  </CardActions>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>

        </Box>
      </main>
      {/* Footer */}
      <Box sx={{ bgcolor: 'background.paper', p: 6 }} component="footer">
        <Typography variant="h6" align="center" gutterBottom>
          Footer
        </Typography>
        <Typography
          variant="subtitle1"
          align="center"
          color="text.secondary"
          component="p"
        >
          Something here to give the footer a purpose!
        </Typography>
        <Copyright />
      </Box>
      {/* End footer */}
    </ThemeProvider>
  );
}
